(1, 1, '2021-09-15 11:58:40', '2021-09-15 11:58:40', '<!-- wp:paragraph -->\n<p>Welkom bij WordPress. Dit is je eerste bericht. Bewerk of verwijder het, start dan met schrijven!</p>\n<!-- /wp:paragraph -->', 'Hallo wereld!', '', 'publish', 'open', 'open', '', 'hallo-wereld', '', '', '2021-09-15 11:58:40', '2021-09-15 11:58:40', '', 0, 'https://localhost/webShop/wordpress/?p=1', 0, 'post', '', 1),
(2, 1, '2021-09-15 11:58:40', '2021-09-15 11:58:40', '<!-- wp:paragraph -->\n<p>Dit is een voorbeeldpagina. Het is anders dan een blog bericht omdat het op één plek blijft en tevoorschijn komt in je site navigatie (in de meeste thema\'s). De meeste mensen starten met een Over pagina dat hen voorstelt aan potentiële site bezoekers. Het zou iets als dit kunnen zeggen:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hoi daar! Ik ben een fietskoerier in het dagelijks leven en een beginnende acteur in de avonduren, en dit is mijn site. Ik leef in Los Angeles, heb een leuke hond genaamd Jack en ik hou van pi&#241;a coladas. (En overvallen worden door de regen.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...of zoiets als dit:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>De XYZ Doohickey Company is opgericht in 1971 en heeft sindsdien kwalitatieve doohickeys aan het publiek geleverd. Gevestigd in Gotham City, heeft XYZ meer dan 2000 mensen in dienst en doet allerlei fantastische dingen voor de community in Gotham.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Als nieuwe WordPress gebruiker kan je naar <a href=\"https://localhost/webShop/wordpress/wp-admin/\">je dashboard</a> gaan om deze pagina te verwijderen en nieuwe pagina\'s toe te voegen voor je inhoud. Veel plezier!</p>\n<!-- /wp:paragraph -->', 'Voorbeeld pagina', '', 'publish', 'closed', 'open', '', 'voorbeeld-pagina', '', '', '2021-09-15 11:58:40', '2021-09-15 11:58:40', '', 0, 'https://localhost/webShop/wordpress/?page_id=2', 0, 'page', '', 0),
(3, 1, '2021-09-15 11:58:40', '2021-09-15 11:58:40', '<!-- wp:heading --><h2>Wie zijn we</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Ons site-adres is: https://localhost/webShop/wordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Welke persoonlijke gegevens we verzamelen en waarom we die verzamelen</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Reacties</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Als bezoekers reacties achterlaten op de site, verzamelen we de gegevens getoond in het reactieformulier, het IP-adres van de bezoeker en de browser user agent om te helpen spam te detecteren.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Een geanonimiseerde string, gemaakt op basis van je e-mailadres (dit wordt ook een hash genoemd) kan worden gestuurd naar de Gravatar service indien je dit gebruikt. De privacybeleidspagina kun je hier vinden: https://automattic.com/privacy/. Nadat je reactie is goedgekeurd, is je profielfoto publiekelijk zichtbaar in de context van je reactie.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Als je een geregistreerde gebruiker bent en afbeeldingen naar de site upload, moet je voorkomen dat je afbeeldingen uploadt met daarin EXIF GPS locatie gegevens. Bezoekers van de site kunnen de afbeeldingen van de site downloaden en de locatiegegevens inzien.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contactformulieren</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Wanneer je een reactie achterlaat op onze site, kun je aangeven of je naam, je e-mailadres en site in een cookie opgeslagen mogen worden. Dit doen we voor je gemak zodat je deze gegevens niet opnieuw hoeft in te vullen voor een nieuwe reactie. Deze cookies zijn een jaar lang geldig. </p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Indien je onze inlogpagina bezoekt, slaan we een tijdelijke cookie op om te controleren of je browser cookies accepteert. Deze cookie bevat geen persoonlijke gegevens en wordt verwijderd zodra je je browser sluit.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Zodra je inlogt, zullen we enkele cookies bewaren in verband met jouw login informatie en schermweergave opties. Login cookies zijn 2 dagen geldig en cookies voor schermweergave opties 1 jaar. Als je &quot;Herinner mij&quot; selecteert, wordt je login 2 weken bewaard. Zodra je uitlogt van jouw account, worden login cookies verwijderd.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Wanneer je een bericht wijzigt of publiceert wordt een aanvullende cookie door je browser opgeslagen. Deze cookie bevat geen persoonlijke data en heeft enkel het post ID van het artikel wat je hebt bewerkt in zich. Deze cookie is na een dag verlopen.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Ingesloten inhoud van andere sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Berichten op deze site kunnen ingesloten (embedded) inhoud bevatten (bijvoorbeeld video\'s, afbeeldingen, berichten, etc.). Ingesloten inhoud van andere sites gedraagt zich exact hetzelfde alsof de bezoeker deze andere site heeft bezocht.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Deze sites kunnen gegevens over je verzamelen, cookies gebruiken, extra tracking van derde partijen insluiten en je interactie met deze ingesloten inhoud monitoren, inclusief het vastleggen van de interactie met ingesloten inhoud als je een account hebt en ingelogd bent op die site.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Met wie we jouw gegevens delen</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Als je een wachtwoord reset aanvraagt, wordt je IP-adres opgenomen in de reset e-mail.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Hoe lang we jouw gegevens bewaren</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Wanneer je een reactie achterlaat dan wordt die reactie en de metadata van die reactie voor altijd bewaard. Op deze manier kunnen we vervolgreacties automatisch herkennen en goedkeuren in plaats van dat we ze moeten modereren.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Voor gebruikers die zich op onze site registreren (indien aanwezig), slaan we ook de persoonlijke informatie op die ze verstrekken in hun gebruikersprofiel. Alle gebruikers kunnen op ieder moment hun persoonlijke informatie bekijken, bewerken of verwijderen (behalve dat ze hun gebruikersnaam niet kunnen wijzigen). Site beheerders kunnen deze informatie ook bekijken en bewerken.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Welke rechten je hebt over je gegevens</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Als je een account hebt op deze site of je hebt reacties achter gelaten, kan je verzoeken om een exportbestand van je persoonlijke gegevens die we van je hebben, inclusief alle gegevens die je ons opgegeven hebt. Je kan ook verzoeken dat we alle persoonlijke gegevens die we van je hebben wissen. Dit bevat geen gegevens die we verplicht moeten bewaren in verband met administratieve, wettelijke of beveiligings doeleinden.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Waar we jouw gegevens naartoe sturen</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Mogelijk worden reacties van bezoekers gecontroleerd via een geautomatiseerde spamdetectie service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Jouw contactinformatie</h2><!-- /wp:heading --><!-- wp:heading --><h2>Aanvullende informatie</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Hoe we jouw gegevens beschermen</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Welke datalek procedures we geïmplementeerd hebben</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Van welke derde partijen we gegevens ontvangen</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Wat voor geautomatiseerde besluitvorming en/of profilering we doen met gebruikersgegevens</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Openbaarmakingsverplichtingen van de industrie</h3><!-- /wp:heading -->', 'Privacybeleid', '', 'draft', 'closed', 'open', '', 'privacybeleid', '', '', '2021-09-15 11:58:40', '2021-09-15 11:58:40', '', 0, 'https://localhost/webShop/wordpress/?page_id=3', 0, 'page', '', 0),
