(37, 1, '2021-09-16 11:37:24', '2021-09-16 11:37:24', 'Gotham City has always been dangerous, but now, it’s downright deadly! Following the tragedy of “A-Day,” the mayor allowed the private law enforcement group known as the Magistrate to take over policing so-called mask crime—and that has given rise to a new Dark Knight! What is this mysterious crimefighter’s connection to former Batman weaponeer Lucius Fox? The fight for justice has never been this dangerous!\r\n\r\nThen, in a new tale of the Outsiders, everything in Gotham City may be under the thumb of the Magistrate, but even members of that totalitarian force know that the outskirts of town are protected by the sword of Katana!\r\n\r\nPlus, ride with the Arkham Knights on their quest for freedom. Arkham Asylum has been decommissioned and the Magistrate rules the land with an iron fist and zero tolerance. Now it’s time for the lunatics to take back their town! Follow Croc, Two-Face, Phosphorus, Zsasz, Clayface and Astrid Arkham as the Arkham Knights raise holy hell on the occupiers of Gotham!', 'The next Batman', '', 'publish', 'closed', 'closed', '', 'the-next-batman', '', '', '2021-10-06 19:34:34', '2021-10-06 19:34:34', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=37', 0, 'products', '', 0),
(38, 1, '2021-09-16 11:38:08', '2021-09-16 11:38:08', 'MARK MILLAR and STEVE MCNIVEN-who last teamed for the monumental CIVIL WAR-bring us the most important WOLVERINE story of the 21st Century. Nobody knows what happened on the night the heroes fell. All we know is that they disappeared and evil triumphed and the bad guys have been calling the shots ever since. What happened to Wolverine is the biggest mystery of all. For 50 years, no one has heard hide nor hair from him...and in his place stands an old man called Logan. A man concerned only about his family. A man pushed to the brink by the HULK GANG. A man forced to help an old friend-the blind archer, HAWKEYE-to drive three thousand miles to secure his family\'s safety. Get ready for the ride of your life, Logan. Collecting WOLVERINE #66-72 &amp; WOLVERINE GIANT-SIZE OLD MAN LOGAN.', 'Wolverine:  Old Man Logan', '', 'publish', 'closed', 'closed', '', 'wolverine-old-man-logan', '', '', '2021-10-06 19:33:10', '2021-10-06 19:33:10', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=38', 0, 'products', '', 0),
(39, 1, '2021-09-16 11:38:54', '2021-09-16 11:38:54', 'DARKNESS REIGNS! After a campaign across the galaxy, Knull\'s death march arrives to Earth and, worse yet, he hasn\'t come alone! With an army of hundreds of thousands of symbiote dragons at his command, the King in Black is a force unlike any Earth\'s heroes have ever faced. EDDIE BROCK, A.K.A. VENOM has seen firsthand the chaos that even one of Knull\'s symbiotic monsters can wreak - will he survive an encounter with the God of the Abyss himself? From Donny Cates, Ryan Stegman, JP Mayer, Frank Martin and VC\'s Clayton Cowles comes the definitive chapter in their two-year-long VENOM saga that changed everything you thought you knew about symbiotes!', 'King In Black', '', 'publish', 'closed', 'closed', '', 'king-in-black', '', '', '2021-10-06 19:31:40', '2021-10-06 19:31:40', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=39', 0, 'products', '', 0),
(40, 1, '2021-09-16 11:39:48', '2021-09-16 11:39:48', 'The lightning-fast and action-packed “Surge” storyline races to its conclusion as Wally West returns to the present day with a new perspective on the past and a reinvigorated desire to take back the mantle of the Flash. With one last hurdle to leap, Wally puts the past behind him, but he’ll need to propel himself further and faster than ever before to do it.', 'The Flash annual #1', '', 'publish', 'closed', 'closed', '', 'the-flash-annual-1', '', '', '2021-10-06 19:30:40', '2021-10-06 19:30:40', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=40', 0, 'products', '', 0),
(41, 1, '2021-09-16 11:43:13', '2021-09-16 11:43:13', 'As Robert E. Howard posited, when King Conan grows restless on the throne, he sails west, toward land and adventure unknown. Now see the first step of King Conan’s fateful journey from Aquilonia, as an old and terrible danger threatens to end the saga of the Cimmerian once and for all!', 'King Conan #1', '', 'publish', 'closed', 'closed', '', 'king-conan-1', '', '', '2021-10-06 19:29:46', '2021-10-06 19:29:46', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=41', 0, 'products', '', 0),
(42, 1, '2021-09-16 11:52:32', '2021-09-16 11:52:32', 'A QUEST FOR TRUTH…A JOURNEY OF DESTRUCTION! DARTH VADER\'S search for revenge against those who hid his son Luke reaches a terrible climax - at the tomb of PADMÉ AMIDALA! What secrets does he learn? And who will pay as a result? All the answers are coming - in the ruins of POLIS MASSA - the birthplace of Luke Skywalker!', 'Star Wars:  Darth Vader #5', '', 'publish', 'closed', 'closed', '', 'star-wars-darth-vader-5', '', '', '2021-10-06 19:28:23', '2021-10-06 19:28:23', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=42', 0, 'products', '', 0),
(43, 1, '2021-09-16 11:53:34', '2021-09-16 11:53:34', 'An amazing softcover edition collecting the 6-part tale originally presented in ACTION COMICS #812-813, ADVENTURES OF SUPERMAN #625-626 and SUPERMAN #202-203! The Man of Steel finds himself on Krypton — but can he escape and return to Earth?', 'Superman: Godfall', '', 'publish', 'closed', 'closed', '', 'supperman-godfall', '', '', '2021-10-06 19:27:54', '2021-10-06 19:27:54', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=43', 0, 'products', '', 0),
(44, 1, '2021-09-16 11:54:22', '2021-09-16 11:54:22', 'Peter Parker. Spider-Man. Scientist. Troublemaker? Thanks to none other than Tony Stark, a new scientific research station for the teenage heroes of the Marvel Universe has just been completed – and Spider-Man just got an invitation to join! Working alongside some of your favorite faces from the MU and a whole bunch of awesome new gadgets, and with Iron Man keeping an eye on the them, surely everything’s going to go great for the heroes, right? - Right? Face front, True Believers, and treat yourself to this first issue in an adventure of the WORLDWIDE ENGINEERING BRIGADE!', 'The Amazing  Spider-Man #72', '', 'publish', 'closed', 'closed', '', 'the-amazing-spider-man-72', '', '', '2021-10-06 12:32:57', '2021-10-06 12:32:57', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=44', 0, 'products', '', 0),
(45, 1, '2021-09-16 11:54:53', '2021-09-16 11:54:53', 'In a land beyond time, a shining tower stands, deploying its operatives across the Multiverse to hold against the encroaching darkness! Who is the mysterious Avenger Prime, and how will his advent impact on the past, the present, and the very future of the mighty Avengers?', 'Avengers/Hulk #1', '', 'publish', 'closed', 'closed', '', 'avengers-hulk-1', '', '', '2021-10-06 19:27:19', '2021-10-06 19:27:19', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=45', 0, 'products', '', 0),
(46, 1, '2021-09-23 08:11:57', '2021-09-23 08:11:57', 'The amazing new creative team of Gail Simone, John Byrne and Nelson reveals the truth about the terrifying new villain Repulse, who levels half the city in her search for Dr. Polaris. And Superman is helpless before her power...', 'ACTION COMICS #828', '', 'publish', 'closed', 'closed', '', 'action-comics-828', '', '', '2021-10-06 19:25:55', '2021-10-06 19:25:55', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=46', 0, 'products', '', 0),
(47, 1, '2021-09-23 08:12:52', '2021-09-23 08:12:52', 'THE PATH TO JEDI WISDOM…OR A DEADLY TRAP OF THE DARK SIDE? THE FORCE led LUKE SKYWALKER to someone who can provide him with great insight into the path to JEDI wisdom…But their meeting will change Skywalker FOREVER. Luke thought his duel against his father, Darth Vader, was the ultimate test. But Luke’s trials have only just begun. The galaxy needs Luke Skywalker. And a Jedi needs a weapon! Meanwhile, Vader continues his search for his long-lost son, and the REBEL ALLIANCE finds itself on the verge of a losing all hope.', 'Star Wars (2020) #6', '', 'publish', 'closed', 'closed', '', 'star-wars-2020-6', '', '', '2021-10-06 19:24:57', '2021-10-06 19:24:57', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=47', 0, 'products', '', 0),
(48, 1, '2021-09-23 08:13:37', '2021-09-23 08:13:37', 'DANGER ON ALL SIDES! Epsilon Station is overrun with danger, not all of it from Xenomorphs! Cruz holds mission information back from his soldiers, but he\'s not the only one with secrets. We are not who we say we are.', 'Alien #3', '', 'publish', 'closed', 'closed', '', 'alien-3', '', '', '2021-10-06 19:22:07', '2021-10-06 19:22:07', '', 0, 'https://localhost/wordpress/?post_type=products&#038;p=48', 0, 'products', '', 0),
